import React, { useContext } from "react";

import { GridContext } from "../contexts/GridContext";

import SubDivision from "./SubDivision";
import "../App";

function SubDivisionContainer() {
  const { instruments } = useContext(GridContext);
  return (
    <div className="subdivision-container">
      {instruments["A1"].map(_, index => (
        <SubDivision element={index} className={`subdivision subdiv-active`} />
      ))}
    </div>
  );
}

export default SubDivisionContainer;
